import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles((theme)=>({
   appbar : {
       background:'#000'
   },

   toolbar:{
       justifyContent:'space-between'
   },
   typography:{
       cursor:'pointer',
       fontSize:'1.5rem',
       displayItems:'center',
       marginLeft:'24px',
       fontWeight:'bold'
   },
   menuicon:{
       color:'#fff'
   }

}))

export  default useStyles
